    <p>{props.show.summary.replace(/<[/]?p>/g, '')}</p>

  </Layout>
)

export const Content = (props) => (
  <div>
    <p>This is practice nextJS</p>
  </div>
)

export default (props) => (
  <Layout>
    <Content />
